import { useState } from "react";
import "./App.css";
import { MovieForm } from "./components/add-movie-form/movieform";
import { MovieCard } from "./components/card";

function App() {
  let data = [
    {
      title: "Rustom",
      URL: "https://static-koimoi.akamaized.net/wp-content/new-galleries/2016/03/rustom-movie-posters.jpg",
    },
    {
      title: "Money Heist",
      URL: "https://images.thequint.com/thequint%2F2021-09%2Fb9aab177-f368-4185-91b4-b37f15c2b7ee%2Fmoneyheist.png?auto=format%2Ccompress&fmt=webp",
    },
    {
      title: "Lucifer",
      URL: "https://img.goldposter.com/2020/07/really-sad-devil-guy_poster_goldposter_com_2.jpg?x-oss-process=image/resize,m_fill,h_450,w_800/quality,q_80",
    },
  ];

  // const [movieData, setMovieData] = useState();
  // const [renderer, setrenderer] = useState();

  const newMovie = (Movie) => {
    data.push(Movie);
    console.log(data);
  };

  return (
    <div className="App">
      <div className="movie-form">
        <MovieForm newMovieInfo={newMovie} />
      </div>

      <div className="moviecard-display">
        {data.map((movie) => (
          <MovieCard
            name={movie.title}
            discription={movie.discription}
            url={movie.URL}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
